import React from 'react';
import '../App.css';

const NiceBox = props => (
    <div>
    <div class="niceBox"></div>
    
    <div class="niceBox">
        <h1 class="lowerNiceBox left">One</h1>
        <h1 class="lowerNiceBox right">Two</h1>
    </div>
    </div>
)

export default NiceBox
